INSERT INTO `qs_pms` VALUES ('17080','1','','0','15092','泰禾光电','所有注册企业请上传营业执照\r\n本着对网站求职者的负责，同时增加网站企业会员发布信息的公信力，网站设置会员注册后，必须上传营业执照，通过企业审核，方可发布招聘信息，否则发布信息一律无法显示。\r\n\r\n为什么要上传营业执照： ① 通过认证后您将获得更多权限；\r\n② 通过认证后可额外获得积分；\r\n③ 通过认证后可增加信息的可信度，成为已认证企业；\r\n注：上传营业执照仅供我们审核，绝不会用任何形式对外公开。','1423453548','1','1423453548','0');
INSERT INTO `qs_pms` VALUES ('17081','1','','0','15093','中国人寿金燕','所有注册企业请上传营业执照\r\n本着对网站求职者的负责，同时增加网站企业会员发布信息的公信力，网站设置会员注册后，必须上传营业执照，通过企业审核，方可发布招聘信息，否则发布信息一律无法显示。\r\n\r\n为什么要上传营业执照： ① 通过认证后您将获得更多权限；\r\n② 通过认证后可额外获得积分；\r\n③ 通过认证后可增加信息的可信度，成为已认证企业；\r\n注：上传营业执照仅供我们审核，绝不会用任何形式对外公开。','1423472269','1','1423472269','0');
